	class KeramikImageDb {
	private:
		static KeramikImageDb *m_inst;
		QDict<QImage> *db;

		KeramikImageDb() {
			db = new QDict<QImage>( 23 );
			db->setAutoDelete( true );

			for ( int i = 0; i < 23; i++ ) {
				QImage *img = new QImage( (uchar*)image_db[i].data,
						image_db[i].width, image_db[i].height,
						32, NULL, 0, QImage::LittleEndian );

				if ( image_db[i].alpha )
					img->setAlphaBuffer( true );

				db->insert( image_db[i].name, img );
			}
		}

		~KeramikImageDb() {
			delete db;
		}

	public:
		static KeramikImageDb* instance() {
			if ( ! m_inst ) m_inst = new KeramikImageDb;
			return m_inst;
		}

		static void release() {
			if ( m_inst ) delete m_inst;
			m_inst = NULL;
		}

		QImage *image( const QString &name ) const {
			return db->find( name );
		}

	}; // class KeramikImageDb

	KeramikImageDb *KeramikImageDb::m_inst = NULL;

